function CreateCritters(critter_number)
	local RandomX = 0
	local RandomY = 0
	local Count = 0
	-- create critters
	Count = critter_number
	while (Count > 0) do
		RandomX = SyncRand(Map.Info.MapWidth)
		RandomY = SyncRand(Map.Info.MapHeight)
		if (RawTile(RandomX, RandomY) == "Land" or RawTile(RandomX, RandomY) == "Rough") then
